import logo from './logo.svg';
import './App.css';
import Header from './paginacion/Header';
import Footer from './paginacion/Footer';
import Path from './paginacion/Path';
import { Routes, Route } from 'react-router-dom';
import index from './paginacion';
import Rutas from './paginacion/Rutas';
import Login from './paginacion/Login';


function App() {
  return (
    <div className="App">
      <h1>RUTAS</h1>
      <Routes>
        <Route path='/'  Component={ Rutas  }>
          <Route path='/home' Component={ index }></Route>
          <Route path='/login' Component={ Login  }></Route>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
